import React from 'react';
import { ShoppingCart } from 'lucide-react';

interface ToToServicesProps {
  className?: string;
}

const ToToServices: React.FC<ToToServicesProps> = ({ className = '' }) => {
  const services = [
    "Thủ tục phản đối đơn đăng ký bảo hộ nhãn hiệu tại Việt Nam.",
    "Hỗ trợ gửi thư khuyến cáo đến các đối tượng xâm phạm về quyền sở hữu nhãn hiệu.",
    "Hỗ trợ gửi công văn đến cơ quan nhà nước có thẩm quyền yêu cầu áp dụng các biện pháp xử phạt đối với các đối tượng xâm phạm quyền sở hữu trí tuệ."
  ];

  return (
    <div className={`w-full ${className}`}>
      {/* Header Section */}
      <section className="py-16 bg-gray-50">
        <div className="max-w-7xl mx-auto px-4">
          <div className="text-center">
            <div className="inline-flex items-center justify-center w-16 h-16 bg-blue-100 rounded-full mb-6">
              <ShoppingCart className="w-8 h-8 text-blue-600" />
            </div>
            <h2 className="text-2xl md:text-3xl font-bold text-gray-800 uppercase tracking-wide">
              CÁC DỊCH VỤ MÀ LUẬT TOTO CUNG CẤP
            </h2>
          </div>
        </div>
      </section>

      {/* Services List Section */}
      <section className="py-12 bg-white">
        <div className="max-w-4xl mx-auto px-4">
          <div className="bg-white rounded-lg shadow-sm border border-gray-100 p-8">
            <ol className="space-y-6 text-gray-700 leading-relaxed">
              {services.map((service, index) => (
                <li key={index} className="flex items-start">
                  <span className="inline-flex items-center justify-center w-8 h-8 bg-blue-600 text-white rounded-full text-sm font-semibold mr-4 mt-0.5 flex-shrink-0">
                    {index + 1}
                  </span>
                  <span className="text-base md:text-lg">
                    {service}
                  </span>
                </li>
              ))}
            </ol>
          </div>
        </div>
      </section>
    </div>
  );
};

export default ToToServices;
